 <h4 class=&quot;font-medium text-gray-900 mb-2&quot;>Nova resolução ANTT sobre rastreamento veicular</h4>
 <p class=&quot;text-gray-700 text-sm leading-relaxed&quot;>A ANTT publicou nova regulamentação exigindo sistemas de rastreamento mais robustos para frotas comerciais a partir de março/2024.</p>
 <div class=&quot;bg-red-50 p-3 rounded-lg&quot;>
 <p class=&quot;text-red-800 text-sm font-medium&quot;>⚠️ Impacto: Gestores precisam adequar sistemas até 30/03. Infleet já está 100% compatível.</p>
